export default function getListStudents() {
    const students = new Map();
    students.set(1, { firstName: 'Guillaume', location: 'San Francisco' });
    students.set(2, { firstName: 'James', location: 'Columbia' });
    students.set(5, { firstName: 'Serena', location: 'San Francisco' });
    return Array.from(students);
  }
